  |Near the house at Taiamai is a sacred
  rock which has hollows that are often
  filled with water. One day a large white
  bird came to drink from one of these
  hollows. The people did not know where
  the bird had come from, and called their
  chief, Kaitara. Kaitara then proclaimed,
  “My people, this beautiful bird has
